css:
.go-plus-accordion {
  padding: 0;
  margin: 0;
}
.go-plus-accordion-header {
  padding: 2.5px 5px;
  background-color: #303241;
  cursor: default;
  -webkit-user-select: none;
}
.go-plus-accordion-content {
  padding: 5px;
}
.go-plus-accordion-item[open] > .go-plus-accordion-header {
  border-bottom: 1px solid #21222c;
}
.go-plus-accordion-item + .go-plus-accordion-item .go-plus-accordion-header {
  border-top: 1px solid #21222c;
}
.go-plus-accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: rgba(120, 125, 155, 0.6);
}
